Information
------------------------------

Anaconda: Silent Killer
Few snakes are feared more and understood less than the Anaconda. The film shows the journey into remote and uncharted parts of the Amazon rainforest to find the truth behind the mythical beast. Lush green forests abound with colorful toucans, noisy howler monkeys, strange tapirs, and vibrant Amazon Indian tribes. But hiding in the dense vegetation and murky swamps is also the biggest and most powerful snake in the world: the Anaconda. This film reveals their true beauty.

